subSubSection.paragraph:
Distribution: See Fig. 19 . Found throughout the Durack, Pentecost, and Ord rivers in the Eastern Kimberley region (
Western Australia
).

General body and jaw morphology similar to 

S. trigonicus

and 

S. wunambal

, but is distinguishable from both as on average it has a wider jaw 35 (25.3–39.8) % HL versus 31.7 (26.1–36.8) % SL (

S. trigonicus

) and 31.2 (29.2– 35.2) % HL (

S. wunambal

) respectively, and longer fins measurements including: anal fin length 24.4 (22.8–27.2) % SL versus 18.4 (18.4–25.0) % SL (

S. trigonicus

) and 21.2 (19.8–22.7) % SL (

S. wunambal

), dorsal spine length 14.5 (12.8–16.4) % SL versus 12.4 (10.3–14.6) % SL (

S. trigonicus

) and 10.7 (10.0–11.5) % SL (

S. wunambal

), anal ray length 17.0 (16.0–17.7) % SL versus 15.5 (11.7–17.3) % SL (

S. trigonicus

) and 14.7 (12.6–17.2) % SL (

S. wunambal

), pectoral fin length 21.0 (20.0–22.2) % SL versus 18.5 (15.5–20.7) % SL (

S. trigonicus

) and 18.6 (17.3–20.3) % SL (

S. wunambal

), pelvic ray length 20.0 (18.9–21.5) % SL versus 18 (14.2–20.9) % in SL (

S. trigonicus

) and 17 (16.0–18.4) % in SL (

S. wunambal

), pelvic fin length 21.7 (20.5–23.9) % SL versus 19 (16.2– 21.3) % SL (

S. trigonicus

) and 18.6 (18.0–19.3) % SL (

S. wunambal

), pelvic spine length 11.3 (10.2–12.6) % SL versus 9.4 (6.9–11.2) % SL (

S. trigonicus

) and 8.8 (4.4–10.1) % SL (

S. wunambal

) and upper caudal lobe length 19.3 (17.7–20.8) % SL versus 22.4 (17.1–26.5) % SL (

S. trigonicus

) and 21.8 (19.8–23.8) % SL (

S. wunambal

). Also, 2–3 more horizontal stripes are present on the body, a character that is consistent across its range. Stripes are particularly useful distinguishing juveniles as they are most often present.
